import React, { Component } from 'react'
import { Row, Col, Card, List, Typography, Carousel } from 'antd'
import Left from './Left';
import Mid from './Mid';
import Right from './Right';
const data = [
    'Racing car sprays burning .',
    'Japanese princess to .',
    'Australian walks 100km ',
    'Man charged over missing',
    'Los Angeles battles',
];
const contentStyle = {
    height: '233px',
    color: '#fff',
    lineHeight: '160px',
    textAlign: 'center',
    background: '#364d79',
};

class QjLevel extends Component {

    render() {
        return (
            <div className='qj-level'>

                <div className='tangle'>
                    {/* <img  /> */}
                    <span>强军阶梯</span>
                </div>
                <Row style={{ marginTop: "10px" }}>
                    <Col span={6} >
                        <Left />
                    </Col>
                    <Col span={6}>
                        <Mid />
                    </Col>
                    <Col span={12}>
                        <Right />
                    </Col>
                </Row>
            </div>
        )
    }
}

export default QjLevel;
